import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'

class ChatBar extends React.Component {
    render() {
        return (
            <div>
                <input type="text" name="chat"></input>
                <button type="button">Send</button>
            </div>
        )
    }
}

// ========================================

ReactDOM.render(
    <ChatBar />,
    document.getElementById('root')
)
